def a(n):
    if n<8: return n
    elif n==8: return 9
    elif n>8 and n<=27:
        c=max(1, ((n + 3)//6))
        r=(n + 2)%c
        q=((n + 2)//c) - 2
        return q**(c - r)*(q + 1)**r
    else:
        q=((n + 2)//6)
        r=(n + 2)%6
        return 4**(q - r)*5**r
print([a(n) for n in range(1, 101)]) # _Indranil Ghosh_, Jun 27 2017, after Mathematica code

